import styled from 'styled-components';

export const Header = styled.header`

  height: 740px;
  width: 1280px;
  `;

export const StyledHeaderImage = styled.img`
z-index: 0;
position: absolute;

`;

export const InfoAboutBlurred = styled.img`
position: absolute;
z-index: 1;
  width: 499px;
  height: 450px;
  z-index: 1;
  background: rgba(0, 0, 0, 0.2);
filter: blur(20px);
top: 171px;




`;
